/**
 * Interfaccia per i dati di un'immagine
 */
export interface IGridImageData {
    /** Immagine come stringa base64 (es. 'data:image/jpeg;base64,...') */
    base64Image: string;
    /** Testo descrittivo da mostrare sotto l'immagine */
    description: string;
}

/**
 * Opzioni per la creazione della griglia PDF
 */
export interface IGridOptions {
    /** Il numero di colonne desiderato per la griglia */
    columns: number;
    /** La larghezza fissa per ogni immagine (per uniformità) */
    imageWidth: number;
    /** Spaziatura tra le celle della griglia */
    cellPadding: number;
}

/**
 * Compone un documento PDF con una griglia di immagini e descrizioni.
 *
 * @param imageData Array di oggetti immagine/descrizione
 * @param options Opzioni per configurare la griglia
 * @returns La definizione del documento pdfMake (TDocumentDefinitions)
 */
export function createImageGridPdf(imageData: IGridImageData[], options: IGridOptions) {
    const { columns, imageWidth, cellPadding } = options;

    // 1. Costruire il corpo della tabella (la nostra griglia)
    const tableBody: TableCell[][] = [];
    let currentRow: TableCell[] = [];

    for (let i = 0; i < imageData.length; i++) {
        const item = imageData[i];

        // Crea il contenuto della cella (immagine + testo)
        const cellContent: Content = {
            stack: [
                {
                    image: item!.base64Image,
                    width: imageWidth,
                    alignment: 'center',
                },
                {
                    text: item!.description,
                    alignment: 'center',
                    margin: [0, 5, 0, 0], // Margine tra immagine e testo
                    fontSize: 10,
                },
            ],
            // Applica la spaziatura attorno al contenuto della cella
            margin: cellPadding,

            //alignment: (((imageData.length-1)===i)&&((i%2)==1))?'center':'justify',
        };
        currentRow.push(cellContent);

        // 2. Se la riga è piena O è l'ultimo elemento, aggiungila al corpo
        if (currentRow.length === columns || i === imageData.length - 1) {
            // 3. Se è l'ultimo elemento ma la riga non è piena, riempi con celle vuote
            while (currentRow.length < columns && i === imageData.length - 1) {
                currentRow.push({}); // Cella vuota
            }
            tableBody.push(currentRow);
            currentRow = []; // Resetta per la prossima riga
        }

    }

    const widths = Array(columns).fill('*');
    return {
        table: {
            widths: widths,
            body: tableBody,
        },
        // Layout 'noBorders' per rimuovere i bordi della tabella
        // e ottenere un puro effetto griglia.
        layout: 'noBorders',
    }
}

/**
 * Converte un array di stringhe in un array di oggetti ContentElement
 * pronti per essere inseriti nel documento.
 *
 * @param texts - L'elenco di stringhe da convertire.
 * @param style - Lo stile da applicare a tutti i nuovi elementi testuali (default: 'body').
 * @returns Un array di ContentElement.
 */
export function createTextContentElements(texts: string[], style: string = 'body'): Content[] {
    return texts.map(text => ({ text: text, style: style }));
}

/**
 * Procedura dimostrativa per inserire un elenco di nuovi testi
 * in una specifica posizione all'interno della struttura di contenuto esistente.
 *
 * NOTA: Per un uso reale, sostituire i valori placeholder (es. 'logokep', formdata)
 * con le tue variabili e logiche effettive.
 *
 * @param existingContent - La parte iniziale della tua array di contenuto.
 * @param newTexts - Le nuove stringhe da inserire.
 * @returns L'array di contenuto completo e aggiornato.
 */
export function insertTextList(existingContent: Content[], newTexts: string[],): Content[] {
    // 1. Converti i nuovi testi in elementi di contenuto con lo stile 'newBody'
    const newTextElements = createTextContentElements(newTexts, 'body');

    // 2. Unisci il contenuto esistente e i nuovi elementi
    // In questo esempio, i nuovi elementi vengono *aggiunti in coda* alla struttura esistente.
    // Se volessi inserirli ad esempio prima della riga TRL, dovresti usare Array.splice() o manipolare gli array.

    return [...existingContent,
    // L'elenco di nuovi testi che hai richiesto di inserire
    ...newTextElements
    ];
}

const calcLevel = (level: string): number => {
    const levelnums = level.trim().split('-');
    let levelNum = 0;
    if (levelnums.length > 1) {
        levelNum += parseInt(levelnums[0]!.trim());
        levelNum += (parseInt(levelnums[1]!.trim()) - parseInt(levelnums[0]!.trim())) / 2;
    } else {
        levelNum += parseInt(level.trim());
    }

    return levelNum;
};

